One-hundred and four five-letter, phonotactically legal nonwords were randomly selected from the ELP database as well. Half of them were randomly selected to be presented as targets; the other half was instead used as unrelated nonword primes. None of the nonwords contained any existing English morpheme. Both the words and non-words used in the experiments are reported in the appendix below. All items (words and nonwords) had a less than 10% error rates in the SUBTLEX$_{US}$, to help ensure that our stimuli were clearly distinguishable as words and pseudowords by most participants.

### Procedure {#sec-exp2-methods-proc}

Experiment 2 followed the same procedures as experiment 1 (see @sec-exp1-methods-proc). The median time to finish the experiment was 5 minutes.

## Data analysis {#sec-exp2-analysis}

Analysis scripts and an abridged version of the data collected can be found online (<https://osf.io/vn3r2>), and consisted of 297,598 observations in total. We performed the same three steps of analysis described for experiment 1 (@sec-exp1-analysis).

### Step 1: subject and item performance {#sec-exp2-analysis-performance}

Item and subject error rates were calculated. The item error rate was never above 14%, so no item was excluded from analysis. 19 subjects were removed because their error rate was above 30%. Thus, a total of 269,652 observations and 2,593 participants were included in further analyses.

### Step 2: prime durations {#sec-exp2-analysis-primeTime}

Prime fluctuations were dealt with in the same way as in experiment 1 (@sec-exp1-analysis-primeTime). The mean (mean = 32.32 ms, sd = 15) and the median (median = 33 ms)  prime durations were closer to the intended value (33 ms). The same prime duration cut-off set for experiment 1 (i.e., any trial whose prime duration was out of the 25-60ms range) removed 13 % of the trials. No participant was excluded, for a total of 237,287 observations.

### Step 3: RT distribution {#sec-exp2-analysis-RT}

After removing the incorrect responses, similarly to experiment 1 (@sec-exp1-analysis-RT), 0.51% of the trials were excluded if their corresponding RT was below 200 ms or above 1800 ms. Finally, 249 subjects were removed because the number of trials within the same condition was less than 7 (i.e., about half of the total number of trials being presented within the same condition, i.e. 13). A total of 210,889 observations and 2,341 subjects were included in the statistical analysis below. 

## Results {#sec-exp2-results}

@tbl-exp2-statsResults below report the descriptive statistics of the experiment. For each frequency condition, priming effects were calculated in the same way as in experiment 1. A 2x2 repeated-measures ANOVA (condition, 2 levels: high vs. low; primetype, 2 levels: unrelated vs. repetition) revealed significant main effects (condition: *F*(1, 2340)=1572, *p*<.0001; primetype: *F*(1, 2340)=1113, *p*<.0001) and interaction *F*(1, 2340)=52.48, *p*<.0001). Planned comparisons confirmed statistically significant repetition priming effects for both word conditions (*MOP_HF*=18 ms, *CI_95%*=[16 20], *t*(2340)=19.7, *p*<.0001; *MOP_LF* = 28 ms, *CI_95%*=[26 30], *t*(2340)=27.8, *p*<.0001), with the low-frequency word repetition priming effect being 10 ms larger than the high-frequency word repetition priming effect. This FAE effect was statistically significant (*M_FAE*=10 ms, *CI_95%*=[7 13]), *t*(2340)=7.24, *p*<.0001l). A very small but statistically significant inhibitory priming effect was observed in the non-word condition (*MOP_NW*=-2 ms, *CI_95%*=[-4 0], *t*(2340)=-2.33, *p*<.0001). As for the word error analysis, we found significant priming effects in the form of fewer errors in repeated compared to unrelated trials in the all conditions (high: *t*(2340)=9.95, *p*<.0001; low: *t*(2340)=16.9, *p*<.0001; non-word: *t*(2340)=-3.27, *p*=.001).

